"Pininfarina AERO GT SERIES"<br><br>
●簡単脱着　スマート・クランプ（スクエアバー/エアロカバー対応）<br>
●両開き＆斬新なアウトサイドハンドル（開閉トリガー）採用<br>
●高級感あふれるメタリックカラー採用（ブラックメタリック、シルバーメタリック）<br>
●新外部突起規制対応品（ゴムボール付き）<br><br>

徹底されたエアロダイナミクス<br>
●ＢＯＸ上下部の空気抵抗を抑えるローノーズ、デュヒューザーデザイン<br>
●エアロダイナミクスデザインにより、空気抵抗値を低減<br><br>

大容量かつ流麗なデザインを実現<br>
●センターボリュームを最大化させ、大容量を実現（450,410リッター）<br><br>

■仕様<br>
サイズ：193×86×41cm（バー上寸法39cm）<br>
容量：450L<br>
重量：23.5kg<br>
最大積載荷量：75kg（積載するクルマによって異なります）<br><br><style type="text/css">
